import React from 'react'
import Logo from '../components/Logo'
import Button from '../components/Button'
import './Nav.css'

const Nav = ({onSignOut}) => {
    return (
        <div className='nav'>
            <Logo />
            <Button text='Sign Out' onClickFunction={onSignOut}/>
        </div>
    )
}

export default Nav;
